const WeatherDetails = (props) => {
  console.log(props);

  const renderList = props.weather_data.map((weather_data) => {
    return (
      <tr className="">
        <td className="">
          <h5 className="ui center aligned header">{weather_data.date}</h5>
        </td>
        <td className="single line">{weather_data.minTemp}</td>
        <td className="single line">{weather_data.maxTemp}</td>
        <td className="center aligned">
          {weather_data.instruction}
        </td>
      </tr>
    );
  });

  return (
    <table className="ui celled padded table">
      <thead className="">
        <tr className="">
          <th className="single line">Date</th>
          <th className="">Min Temp</th>
          <th className="">Max Temp</th>
          <th className="">Message</th>
